如保持原狀；財源甚為穩定，且有意外之財，為人慷慨花點錢也是不可避免的事；和心愛之人瘋狂放縱一次，感情能燃燒得更旺。','2020-04-19 13:03:47','2020-04-19 13:03:47'),(118,4,6,2,'愛情運勢★★★★☆',4,'單身者有機會與異性約會，讓你有了戀愛的感覺，沉浸在愛情的甜蜜當中。','2020-04-19 13:03:47','2020-04-19 13:03:47'),(119,4,6,3,'事業運勢★★★☆☆',3,'面對挫折時態度較為成熟，但還是會為了面子問題而鑽牛角尖。','2020-04-19 13:03:47','2020-04-19 13:03:47'),(120,4,6,4,'財運運勢★★★★☆',4,'主動與客戶聯繫，財運不請自來。','2020-04-19 13:03:47','2020-04-19 13:03:47'),(121,4,7,1,'整體運勢★★★☆☆',3,'桃花接踵而至，但每朵桃花出現的方式都不盡相同，還得睜大雙眼哦！熱衷於股市投資的人今天不要急著出手，時機還未成熟；工作中會有不錯的表現機會，可別老待在家裡，機會多來自公司組織的活動哦！','2020-04-19 13:03:47','2020-04-19 13:03:47'),(122,4,7,2,'愛情運勢★★★★☆',4,'夫妻感情融洽，沉浸在家庭的歡樂氣氛中；戀愛中人走訪雙方父母，商討結婚事宜。','2020-04-19 13:03:47','2020-04-19 13:03:47'),(123,4,7,3,'事業運勢★★★☆☆',3,'可做自己長久以來一直想做的事，易如願以償；在圖書館、休閒中心易遇到貴人。','2020-04-19 13:03:47','2020-04-19 13:03:47'),(124,4,7,4,'財運運勢★★☆☆☆',2,'莫過度斤斤計較，否則恐淪為他人眼中的小氣財神。','2020-04-19 13:03:47','2020-04-19 13:03:47'),(125,4,8,1,'整體運勢★★★☆☆',3,'給愛人一個LOVEKISS吧，相信他會覺得異樣的甜蜜；多去朋友、親戚家串串門子，聯絡聯絡感情，大家一起樂活樂活；沒有工作的壓力、沒有擾人的業務聯絡電話，心情大為舒暢。','2020-04-19 13:03:47','2020-04-19 13:03:47'),(126,4,8,2,'愛情運勢★★★☆☆',3,'對情人不妨大方一些，有空多陪對方散散步，買些小禮物表示你的心意，對方會很開心喔！','2020-04-19 13:03:47','2020-04-19 13:03:47'),(127,4,8,3,'事業運勢★★★★☆',4,'思路清晰，是學習新知、提高技能的好時機，可考慮學習進修之事。','2020-04-19 13:03:47','2020-04-19 13:03:47'),(128,4,8,4,'財運運勢★★★☆☆',3,'用活潑與幽默來展現個人魅力，方能開啟財運。','2020-04-19 13:03:47','2020-04-19 13:03:47'),(129,4,9,1,'整體運勢★★★☆☆',3,'今天是放鬆身心的日子，可以玩網路遊戲，讓你沉醉在遊戲的情節，有身臨其境的感覺；也可以看看經典的武俠小說，能喚起你心中成為英雄美女的夢想，讓你感懷生活，激發對美好明天的憧憬。','2020-04-19 13:03:47','2020-04-19 13:03:47'),(130,4,9,2,'愛情運勢★★★☆☆',3,'戀愛中的人感情難以突破，讓你的內心感到不安。別鑽牛角尖，要相信自己也相信對方才行。','2020-04-19 13:03:47','2020-04-19 13:03:47'),(131,4,9,3,'事業運勢★★☆☆☆',2,'容易有一些突如其來的困難讓你措手不及，做事應小心謹慎，感情用事會誤了大事唷！','2020-04-19 13:03:48','2020-04-19 13:03:48'),(132,4,9,4,'財運運勢★★★★☆',4,'當遇到錢財困境時，有貴人相助，事情進行得很順利。','2020-04-19 13:03:48','2020-04-19 13:03:48'),(133,4,10,1,'整體運勢★★★☆☆',3,'情緒掌控得較好，只要對周圍的人多花點心思，就能相處愉快。財運上還需要穩紮穩打，不要太過急進。適合參加團體活動，長袖善舞能為你贏得好口碑。回家時給家人帶份宵夜，會讓他們覺得很溫馨。','2020-04-19 13:03:48','2020-04-19 13:03:48'),(134,4,10,2,