因此放在心上，別忘了日後給對方補償哦。','2020-04-19 14:03:54','2020-04-19 14:03:54'),(151,5,2,3,'事業運勢★★★☆☆',3,'多考慮周圍的人，自顧自的埋頭苦幹效果不一定好。多與同事合作，共同進步。','2020-04-19 14:03:54','2020-04-19 14:03:54'),(152,5,2,4,'財運運勢★★☆☆☆',2,'生意上容易出現意料之外的麻煩。例如：資金周轉困難、債主拖延、貨款出現問題等等。','2020-04-19 14:03:54','2020-04-19 14:03:54'),(153,5,3,1,'整體運勢★★★☆☆',3,'今天要處理的事情雜亂，試著平靜下來，冷靜的頭腦才是處理問題的關鍵；遇到對眼的異性，趕快採取行動吧；財運不太妙，手氣也欠佳，把時間放在其他有意義的事上，會更有收穫。','2020-04-19 14:03:54','2020-04-19 14:03:54'),(154,5,3,2,'愛情運勢★★★☆☆',3,'感受性強的一天，容易為情感傷，沉澱在過去的回憶裡。','2020-04-19 14:03:54','2020-04-19 14:03:54'),(155,5,3,3,'事業運勢★★★☆☆',3,'想離開現在的環境，但諸多的現實考慮，還是無法完全脫身。','2020-04-19 14:03:54','2020-04-19 14:03:54'),(156,5,3,4,'財運運勢★★☆☆☆',2,'提醒自己莫因物慾過重、貪戀花酒而舉債度日。','2020-04-19 14:03:54','2020-04-19 14:03:54'),(157,5,4,1,'整體運勢★★★★☆',4,'處於冷戰或失和的情侶今天有雨過天晴的徵兆，放下面子或某些堅持可緩和兩人的關係；在所在地進行投資能及時進行掌控，進展更為順利；學習上易產生厭倦的心理，無法安下心學習。','2020-04-19 14:03:54','2020-04-19 14:03:54'),(158,5,4,2,'愛情運勢★★★★☆',4,'夫妻之間多尊重彼此的私人空間，多體會彼此的內心感受，感情自然能順利發展。','2020-04-19 14:03:54','2020-04-19 14:03:54'),(159,5,4,3,'事業運勢★★★☆☆',3,'容易有挫折感，主導慾望增加卻往往事與願違，因無法忍受而產生負面思考！','2020-04-19 14:03:54','2020-04-19 14:03:54'),(160,5,4,4,'財運運勢★★★★★',5,'財運還不錯唷！有暗中收到禮物或金錢的機會。商務接洽者適合在競爭中得財。','2020-04-19 14:03:54','2020-04-19 14:03:54'),(161,5,5,1,'整體運勢★★★★★',5,'會有一種「眾裡尋他千百度，驀然回首燈火闌珊處」的感覺。對金錢看得比較淡，花錢也不計後果，有多少就會用多少。這種一個人吃飽、全家不餓的概念可要好好修正了，不然等有了另一半的時候再來改的話，日子就會不好過了哦。','2020-04-19 14:03:54','2020-04-19 14:03:54'),(162,5,5,2,'愛情運勢★★★★★',5,'愛情運強滾滾！羅曼蒂克的色彩濃厚，好好享受今日的美好時光吧！','2020-04-19 14:03:54','2020-04-19 14:03:54'),(163,5,5,3,'事業運勢★★★★☆',4,'運勢不錯，有許多機會讓你發揮、運用，而且容易得到異性朋友從中協助喔！','2020-04-19 14:03:54','2020-04-19 14:03:54'),(164,5,5,4,'財運運勢★★★★☆',4,'財運順暢，賺錢不太費力，股票族可憑著直覺與分析而小有收穫；商務談判者有機會接到訂單；對於一般上班族的影響不大。','2020-04-19 14:03:54','2020-04-19 14:03:54'),(165,5,6,1,'整體運勢★★★★☆',4,'田宅、居所會為你帶來很多瑣碎的問題，令你破費且花心機，還不如保持原狀；財源甚為穩定，且有意外之財，為人慷慨花點錢也是不可避免的事；和心愛之人瘋狂放縱一次，感情能燃燒得更旺。','2020-04-19 14:03:54','2020-04-19 14:03:54'),(166,5,6,2,'愛情運勢★★★★☆',4,'單身者有機會與異性約會，讓你有了戀愛的感覺，沉浸在愛情的甜蜜當中。','2020-04-19 14:03:54','2020-04-19 14:03:54'),(167,5,6,3,'事業運勢★★★☆☆',3,'面對挫折時態度較為成熟，但還是會為了面子問題而鑽牛角尖。','2020-04-19 14:03:54','2020-04-19 14:03:54'),(168,5,6,4,'財運運勢★★★★☆',4,'主動與客戶聯繫，財運不請自來。','2020-04-19 14:03:54','2020-04-19 14:03:54'),(169,5,7,1,'整體運勢★★★☆☆',3,'桃花接踵而至，但每朵桃花出現的方式都不盡相同，還得睜大雙眼哦！熱衷於股市投資的人今天不要急著出手，時機還未成熟；工作中會有不錯的表現機會，可別老待在家裡，機會多來自公司組織的活動哦！','2020-04-19 14:03:54','2020-04-19 14:03:54'),(170,5,7,2,'愛情運勢★★★★☆',4,'夫妻感情融洽，沉浸在家庭的歡樂氣氛中；戀愛中人走訪雙方父母，商討結婚事宜。','2020-04-19 14:03:54','2020-04-19 14:03:54'),(171,5,7,3,'事業運勢★★★☆☆',3,'可做自己長久以來一直想做的事，易如願以償；在圖書館、休閒中心易遇到貴人。','2020-04-19 14:03:54','2020-04-19 14:03:54'),(172,5,7,4,'財運運勢★★☆☆☆',2,'莫過度斤斤計較，否則恐淪為他人眼中的小氣財神。','2020-04-19 14:03:54','2020-04-19 14:03:54'),(173,5,8,1,'整體運勢★★★☆☆',3,'給愛人一個LOVEKISS吧，相信他會覺得異樣的甜蜜；多去朋友、親戚家串串門子，聯絡聯絡感情，大家一起樂活樂活；沒有工作的壓力、沒有擾人的業務聯絡電話，心情大為舒暢。','2020-04-19 14:03:54','2020-04-19 14:03:54'),(174,5,8,2,'愛情運勢★★★☆☆',3,'對情人不妨大方一些，有空多陪對方散散步，買些小禮物表示你的心意，對方會很開心喔！','2020-04-19 14:03:54','2020-04-19 14:03:54'),(175,5,8,3,'事業運勢★★★★☆',4,'思路清晰，是學習新知、提高技能的好時機，可考慮學習進修之事。','2020-04-19 14:03:54','2020-04-19 14:03:54'),(176,5,8,4,'財運運勢★★★☆☆',3,'用活潑與幽默來展現個人魅力，方能開啟財運。','2020-04-19 14:03:54','2020-04-19 14:03:54'),(177,5,9,1,'整體運勢★★★☆☆',3,'今天是放鬆身心的日子，可以玩網路遊戲，讓你沉醉在遊戲的情節，有身臨其境的感覺；也可以看看經典的武俠小說，能喚起你心中成為英雄美女的夢想，讓你感懷生活，激發對美好明天的憧憬。','2020-04-19 14:03:54','2020-04-19 14:03:54'),(178,5,9,2,'愛情運勢★★★☆☆',3,'戀愛中的人感情難以突破，讓你的內心感到不安。別鑽牛角尖，要相信自己也相信對方才行。','2020-04-19 14:03:54','2020-04-19 14:03:54'),(179,5,9,3,'事業運勢★★☆☆☆',2,'容易有一些突如其來的困難讓你措手不及，做事應小心謹慎，感情用事會誤了大事唷！','2020-04-19 14:03:54','2020-04-19 14:03:54'),(180,5,9,4,'財運運勢★★★★☆',4,'當遇到錢財困境時，有貴人相助，事情進行得很順利。','2020-04-19 14:03:54','2020-04-19 14:03:54'),(181,5,10,1,'整體運勢★★★☆☆',3,'情緒掌控得較好，只要對周圍的人多花點心思，就能相處愉快。財運上還需要穩紮穩打，不要太過急進。適合參加團體活動，長袖善舞能為你贏得好口碑。回家時給家人帶份宵夜，會讓他們覺得很溫馨。','2020-04-19 14:03:54','2020-04-19 14:03:54'),(182,5,10,2,'愛情運勢★★★☆☆',3,'你和戀人的關係趨於平順。倘若能培養共同的興趣愛好，感情會更上一層樓唷！','2020-04-19 14:03:54','2020-04-19 14:03:54'),(183,5,10,3,'事業運勢★★★☆☆',3,'雖然要完成的事情很多，但因家人的支持與關心，讓你內心充滿鬥志，辦事效率大增。','2020-04-19 14:03:54','2020-04-19 14:03:54'),(184,5,10,4,'財運運勢★★☆☆☆',2,'徬徨不前、散漫懶惰者，則得財不順，容易流失錢財。','2020-04-19 14:03:54','2020-04-19 14:03:54'),(185,5,11,1,'整體運勢★★★★☆',4,'愛神高調降臨，無需花費心思引人注意，親切的問候或貼心的舉動，已經獲得他的好評。健身房、茶藝館、咖啡廳等休閒娛樂場所是你的幸運地，放鬆的同時，還有機會結識新朋友。手氣平淡，不宜走偏財門路。','2020-04-19 14:03:54','2020-04-19 14:03:54'),(186,5,11,2,'愛情運勢★★★★☆',4,'在聚會中有機會結識成熟穩重的異性朋友，若能保持聯繫，可迅速拉近彼此的距離！','2020-04-19 14:03:54','2020-04-19 14:03:54'),(187,5,11,3,'事業運勢★★★★☆',4,'運勢佳，別一昧追求和諧，該爭取的時候就要堅持，表現你的競爭力。','2020-04-19 14:03:54','2020-04-19 14:03:54'),(188,5,11,4,'財運運勢★★★☆☆',3,'對親戚朋友的打點是一項不可避免的開銷。','2020-04-19 14:03:54','2020-04-19 14:03:54'),(189,5,12,1,'整體運勢★★★☆☆',3,'良好的人際關係，在生活中能為你幫不少忙。收到一堆信件沒有回覆，利用今天的空閒一次處理完畢。桃花運不錯，會有意料之外的相遇，努力表現哦。給父母買套合身的衣服，他們會為有你這麼孝順的子女而開心。','2020-04-19 14:03:54','2020-04-19 14:03:54'),(190,5,12,2,'愛情運勢★★★★☆',4,'已婚者與另一半度過甜蜜，令感情大增；單身者與朋友相處融洽，人氣指數上升！','2020-04-19 14:03:54','2020-04-19 14:03:54'),(191,5,12,3,'事業運勢★★★☆☆',3,'運勢平順，適合調整步伐，別急著向前衝，有機會從他人口中獲得商業信息。','2020-04-19 14:03:54','2020-04-19 14:03:54'),(192,5,12,4,'財運運勢★★★☆☆',3,'對於道聽塗說得來的投資信息，不可全信，只可參考。','2020-04-19 14:03:54','2020-04-19 14:03:54');
